description:
ЦВЕТ В НАЛИЧИИ- ЧЕРНЫЙ, ЗЕЛЕНЫЙ(ОЛИВА), ПИКСЕЛЬ

Тактический рюкзак отлично подходит для военных, охоты, рыбалки, туристических походов, скалолазания, путешествий и спорта.
Рюкзак выполнен из прочной влагозащитной синтетической ткани Oxford 600D. Эргономика рюкзака и применяемые материалы позволяют сохранять его форму вне зависимости от загрузки. Удобное и надежное крепление ремней и лямок способствует надежной фиксации рюкзака на спине и комфортному его использованию даже при необходимости быстро передвигаться.

Особенности рюкзака:
- эргономичные, мягкие плечевые ремни с D-кольцами;
- крепления для дополнительных приспособлений (система MOLLE);
- пояс, регулируемый по длине, снабженный застежкой фастекс;
- прочные стропы;
- уплотненный мягкий слой для уменьшения нагрузки на позвоночник
- размер 483125 
Характеристики материала Oxford 600D:
- водонепроницаемость и водоотталкивающие свойства;
- износостойкость;
- грязеустойчивость;
- термоустойчивость – материал способен сохранять свои свойства при диапазоне температур от — 50 (морозоустойчивость) до +110 (теплоустойчивость);
- высокая прочность;
- повышенная устойчивость к истиранию нитей;
- простота ухода.

Рюкзак объемом 45 это компактный вместительный рюкзак для трехдневных выходов (3-Day Assault Back Pack) и идеально подходит как для полевых, так и для городских условий. 

- Размер: 48*31*25.
- Объем: 45 л.

Отправка по Украине через услугу OLX ДОСТАВКА либо по предоплате (150 грн) или полной, наложенного платежа в чистом виде нет.
САМОВЫВОЗА НЕТ!

Крутая, практичная, технологичная и качественная мноубордическая куртка.
Цвет - насыщенный фиолетовый с черными элементами, "интерьер" - серый с красными зонами карманов, золотистыми элементами отделки вентиляции.
Основные плюсы:
- мембрана 15К / 5К (не считая 6 регулируемых вентиляционных каналов) так что по факту все 15К/25К;
- качественная водо/ветронепроницаемая ткань с рипстопом, с отражателями на рукавах;
- 2 боковых кармана (правый с дополнительным внутренним эластичным карманом для телефона, левый - с карабинчиком для ключей), 2 грудных кармана с сеточкой (в каждый влезет по 7-дюймовому планшету), карман на липучке для скипасса/карточки на левом плече, 2 грудных внутренних кармана (правый - на молнии с эластичным кармашком для плеера/телефона с отверстием выхода наушников/гарнитуры, левый - крупная сеточка для маски, внутри которого еще один маленький эластичный карман), потайной карман под снежной юбкой с незаметной молнией (для заначки от гопников/для apre-ski), карман на липучке под снежной юбкой, огромное отделение на нижней части спины (в районе поясницы) снаружи (можно скрутить пуховик или флис, спрятать 3-литровую упаковку вина);
- все молнии водонепроницаемые, с длинными тканевыми держателями (удобно застегивать в перчатках);
- отстегиваемый и настраиваемый в 2 плоскостях (глубина, ширина) капюшон с козырьком и флисовыми вставками в районе ушей;
- накладка для защиты подбородка от защемления молнией;
- центральная молния работает в обе стороны и закрывается ветрозащитной накладкой на магнитах (когда жарко можно застегиваться только на одни магниты);
- эластичные манжеты под большой палец;
- усиленная локтевая зона;
- снежная юбка может пристегиваться к штанам (2 боковых крепления на кнопках).
Основной "-":
- большой размер для меня(((
При своем размере М свободно помещаюсь в нее с защитой (почему и брал её "с запасом"), но все чаще катаюсь без защиты и большой размер создает неудобства.
Указан размер L, но по факту реальный XL.
Идеально подойдет крупному парню ростом выше 180 см с размером L или XL.
Конструкция внешний защитный рипстоп-мембрана-тканевая сетка обеспечивает сохранение тепла или выведение его излишков через вентиляцию в рукавах, на груди и возле боковых швов со стороны спины с обоих сторон.
Замеры (внешние) в см:
длина по замку -82
длина по спине от воротника - 82
длина рукава от плечевого шва - 65
длина рукава от подмышки -54
ширина в плечах - 54
ширина в подмышках -62 
ширина в нижней части - 62
длина (внутренняя) от воротника до края снежной юбки - 75

