GNC Mega Men – це ефективний полівітамінний комплекс, який забезпечує чоловічий організм всіма необхідними вітамінами, мінералами, макро - і мікроелементами. Компанія GNC є безперечним лідером в розробці і виробництві біодобавок. Продукти найвищої якості – це візитна картка фірма. Не є винятком і вітамінний комплекс Mega Men. Відгуки мільйонів чоловіків по всьому світу підтверджують першокласне якість даної добавки.
Особливості препарату:
– формула, розроблена спеціально для чоловіків, що включає антиоксиданти, вітаміни, мінерали та інші поживні елементи, які організм людини не в змозі отримати зі звичайної їжі щоденного раціону;
– склад капсул вивільняється більше 6 годин, що забезпечує поступове вилучення життєво важливих поживних речовин для цілодобової підживлення організму.
Переваги GNC Mega Men:
– вітаміни В6, В9, В12 забезпечують нормальне функціонування серцево-судинної системи;
– суміш антиоксидантів на основі фруктів і овочів нейтралізує негативний вплив вільних радикалів, захищає мембрани клітин;
– селен, вітаміни С,Е підтримують захисні функції організму;
– вітамін С важливий для нормального росту і відновлення клітин, кровоносних судин, зубів, кісток;
– вітамін Е необхідний для здоров'я серця, легенів, простати, органів шлунково-кишкового тракту;
– вітамін А і лютеїн, що входять до складу GNC Mega Men, необхідні для хорошого зору, підтримки здоров'я очей;
– цинк необхідний для здоров'я репродуктивних органів, хром відіграє важливу роль у метаболізмі глюкози;
– холін, попередник ацетилхоліну, є основою для нервової системи, покращує пам'ять, захищає серце;
– L-аргінін – це умовно-незамінна амінокислота, сприяє вилучення аміаку з організму, який виділяється при синтезі білка. Він також покращує живлення і прискорює відновлення м'язів;
– лікопін, представник каротиноїдів, – це сильний антиоксидант, який бореться з вільними радикалами. Має благотворний вплив на хвороби простати і серця;
– альфа-ліпоєва кислота має антиоксидантні властивості, запобігаючи руйнування білків і клітин.

Як приймати:
2 капсули в день під час їжі.

28 табл - 300грн
04/2024

