Це вже четверта генерація нашої плитоноски і ось що ми удосконалили:
 1. збільшили кишеню для балістичного захисту;
 2. зробили камербанди каркасного типу, щоб не перекручувалися важкі підсумки;
 3. зробили з'ємні демфери, які кріпляться на велкро до внутрішньої строни плитоноски, а також замінили метеріал подушок;
 4. зробили з’ємні передні клапани й додали molle pals для закріплення напашника чи інших підсумків;
 5. удосконалили плечові лямки, вони тепер теж з'ємні та регулюється під будь-який розмір;
 6. тепер можна замінити верхні швидкоскиди на фастекс, або рамку;
 7.  є змога закріпити на камербанди з внутрішньої строни підсумки для бокових плит.

Ми вдосконалюємо наші вироби, аби вам було зручно виконувати бойові завдання й знищувати ворога. 
Ми використовуємо лише якісну тканину й фурнітуру, аби ви відчували себе впевнено й надійно з нашою амуніцією, аби вона не підвела на фронті. 
Ми шиємо на опт для батальйону й виконуємо індивідуальні замовлення під кожного бійця.

Портативная газовая горелка Kovar - просто находка для туристов, рыбаков, геологов, дальнобойщиков и даже дачников. Одним словом, для людей, которые в разной степени сталкиваются с походными условиями. С ее помощью можно без особых усилий приготовить еду или согреть чай, а вот без нее пришлось бы уйму сил и времени тратить на поиск и сбор дров, а затем и на их розжиг. Так что, без газовых горелок очень туго в походах и на рыбалке. Портативная газовая горелка с пьезоподжигом, в отличие от костра, разгорается в считанные секунды и в разы сокращает время закипания воды. ПРЕИМУЩЕСТВА Портативной газовой горелки Kovar: Портативная и легкая газовая плита для туристов, рыболовов и активного отдыха; Даёт отличную тепловую эффективность и супер сильную огневую мощь; С высокой энергией пьезоэлектрическое керамическое зажигание; Складной дизайн, также поставляется с сумкой для удобной переноски. Внимание- баллон в комплект НЕ входит! Баллоны можно заказать отдельно в любом нужном количестве. Всё есть в наличии. 
