Тактичний каремат для сидіння
Каремат військовий — це просто незамінна річ у польових умовах. З ним Ви легко приймите позу сидячи, не отримавши при цьому болючого удару. Завдяки розмірам він добре захистить від потенційних травм, особливо в бойових умовах.

Особливості:

• шар щільного ізолону, загальною товщиною 15мм;
• 2 стропи на кнопках для кріплення до пояса, бронежилету, РПС ;
• також є кріплення на пояс за допомогою фастекса;

Характеристика:
Матеріал: зносостійкий Оксфорд 600D (прорезинений);
Колір: хакі;
Розмір:32x42x2,5 см; внутрішня вставка: 30х40 см.
Наповнювач всередині: ізолон 20 мм. матеріал, який не горить та не розлазиться.
Довжина стропи для кріплення на пояс: 120см
Виготовлений нами каремат для сидіння легко кріпиться на екіпірування за допомогою спеціальних строп і чудово продуманий під систему Molle, яка використовується майже у всіх виробах тактичного напрямку. Військові часто використовують його в парі з РПС або поясом. Ми використовуємо тільки перевірені матеріали, які відмінно себе зарекомендували в польових умовах. Також цей каремат повністю зливається з екіпіруванням і не надає дискомфорту під час щоденної експлуатації.

