Способи доставки товару:

- Доставка по всій Україні до відділення Нової Пошти або на адресу. Для замовлення напишіть в ОЛХ повідомленні або за Вайбером Ваше Прізвище Ім'я, номер телефону, місто, номер відділення Нової Пошти. При замовленні ОЛХ доставки просто натисніть кнопку "Купити з доставкою";

- Самовивіз у Києві за адресом:
вул. Північна, 6А (м. Героїв Дніпра);

Способи оплати товару:

- ОЛХ доставка (безпечна угода від сервісу ОЛХ та НП);

- Післяплатою при отриманні та огляді посилки у відділенні Нової Пошти (вартість послуги на пошті становить 20 грн + 2% від вартості товару);

- Передплата прямим переказом на картку або ФОП рахунок;

- Оплата готівкою або прямим переказом на картку або ФОП рахунок після огляду товару під час зустрічі.

