Компактный тренажер-турник Айрон – приспособление, которое можно легко зафиксировать в верхней части дверной коробки или использовать на полу, в зависимости от вида занятий.

С помощью необычного тренажера-турника Вы сможете выполнять 12 разных упражнений для развития всех групп мышц!

Например, подтягиваться, используя узкий или широкий хват, отжиматься, заниматься детальной проработкой пресса, развивать бицепсы и трицепсы, плечевые мышцы и широчайшие мышцы спины, а также делать многие другие силовые упражнения для физического развития организма.

Характеристики:

- Конструкция: навесная;
- Максимальная нагрузка: 100 кг;
- Длина перекладины для крепления: 45 см;
- Длина всего турника: 94 см;
- -Высота: 33 см;
- Ширина: 27 см;
- Вес: 2 кг;
- Цвет: черно-серый.

Турник подходит для дверного проема шириной от 50 см до 95 см. При этом толщина стены должна быть от 11 до 14 см для прочного крепления турника.

Коллаборация Eberlestock и Carinthia 

Один из самых лучших спальных мешков создан для тех, кто предпочитает комфорт. С ним можно отдохнуть на природе в любое время года.

Если погода теплая, то можно приоткрыть сверху центральную молнию, при низких температурах тепло сохраняет конструкция дефлекторов.

Наполнитель - высококачественный гусиный пух 90/10 с показателем fill power 600. Дифференциальные секции и трапециевидная секция в ногах с поперечными дефлекторами. Капюшон с эластичным шнуром можно затянуть так, чтобы оставить только отверстие для дыхания. Внутри есть большой ветрозащитный клапан на молнии для предотвращения потери тепла. Внешний клапан на молнии служит первой ступенью защиты от холода.

В комплект входит компрессионный мешок для походов.

Температура комфорта – до -20° С;
Температура экстрима - -30° С;
Размер Regular: рост до 184 см;

Вес: 1,7 кг.
